function assignPlayerToAvailableColor(player, color)
    local color = table.remove(available_colors, 1)
    broadcastToAll(
        "Assigning " .. player.steam_name .. " to color " .. color)
    player.changeColor(color)
end

function onPlayerConnect(player)
